import React from 'react';

import App from '../App';
import Footer from '../Footer';

import '../CV.css';

function CV() {
    return (
        <div id="cv">
            <App />
            <div>
                <h2>Education</h2>
                <p>2021 - n/a, Codecademy, <i>Certification, Full-Stack Engineer</i></p>
                <p>2020, University of Houston, <i>BS, Digital Media</i></p>
            </div>
            <Footer />
        </div>
    )
}

export default CV;
